import { React, useEffect } from "react";
import {
  Header,
  Footer,
  HomeOverview,
  Drawer,
} from "../../components/HomePage";
import "./styles.css";

const Home = () => {
  useEffect(() => {
    fetch("/time")
      .then((res) => res.json())
      .then((data) => {
        console.log(data.time);
      });
  }, []);
  return (
    <>
      <div class="home-page-container">
        <Header />
        <Drawer />
      </div>
      <Footer />
    </>
  );
};

export default Home;
